import ToDo from "./ToDo";


const ToDoList = ({data}) => {

  const deleteTask = (id) => {
    ApiClient.deleteTask(id);

  };

  return (
    <div>
      {data.map(todo => {
        return (
          <div>
            <ToDo todo={todo}/>
            <button className="Delete-Task" onClick={deleteTask(todo.id)}>Delete</button>
          </div>
        )
      })}
    </div>
  );
}

export default ToDoList;
